import * as React from 'react';
import Map,{ Marker } from 'react-map-gl';

const MAPBOX_TOKEN = 'pk.eyJ1IjoiYm9saW9saWFndXN0aW4iLCJhIjoiY2t6eDVzcWY5NDJoNTJucW9xaHY2bXA2dCJ9.ZR3iXpsXSNMjzh9Nj-0EDQ';

export function AppMap() {
    return ( 
    <Map
    initialViewState={{
      longitude: -100,
      latitude: 40,
      zoom: 3.5
    }}
    style={{width: 600, height: 400}}
    mapStyle="mapbox://styles/mapbox/streets-v9"
    mapboxAccessToken={MAPBOX_TOKEN}
    >
    <Marker latitude={40.7} longitude={-73.9} color="red"/>
    </Map>
    );
}
